import PropTypes from 'prop-types';

import styles from 'dribbble.module.css';
const Dribbble = ({dribbbleData}) => {
    return(
        <div>
            {dribbbleData.map((data, index)=> (
                <div key={index}>
                   <div>
                        <h1>{data.title}</h1>
                    </div>
                </div>
            ))}
        </div>
    )
}

Dribbble.propTypes = {
    dribbbleData: PropTypes.array
}

export default Dribbble;
